import React, { useRef } from "react";
import html2canvas from "html2canvas";
import { jsPDF } from "jspdf";

const Template1 = ({ resume }) => {
  const {
    first_name,
    last_name,
    phone_number,
    address,
    designation,
    email,
    city,
    description,
  } = resume.about;
  const {
    school,
    degree,
    school_city,
    education_start_date,
    education_end_date,
    education_description,
  } = resume.education;
  const {
    job_title,
    employeer,
    location,
    experience_start_date,
    experience_end_date,
    experience_description,
  } = resume.experience;
  const { project_title, project_link, project_description } = resume.project;
  const { achievement_title = "", achievement_description = "" } =
    resume.achievement;

  const printRef = useRef();

  const handleDownloadPdf = async () => {
    console.log("hellop");
    const element = printRef.current;
    const canvas = await html2canvas(element);
    const data = canvas.toDataURL("image/png");

    const pdf = new jsPDF();
    const imgProperties = pdf.getImageProperties(data);
    const pdfWidth = pdf.internal.pageSize.getWidth();
    const pdfHeight = (imgProperties.height * pdfWidth) / imgProperties.width;

    pdf.addImage(data, "PNG", 0, 0, pdfWidth, pdfHeight);
    pdf.save("print.pdf");
  };

  return (
    <div className="w-full mt-4">
      <div ref={printRef} className="flex justify-start w-full items-start">
        <div className="flex bg-[#353535]  h-screen  text-white flex-col gap-4 p-10 basis-[35%] ">
          <div>
            <div className="underline text-xl mb-2">CONTACT</div>
            <div>{phone_number}</div>
            <div>{email}</div>
            <span>
              {address}
              {city}
            </span>
          </div>
          <div>
            <div className="underline text-xl mb-2">EDUCATION</div>
            <div>{school}</div>
            <div>{school_city}</div>
            <div>{degree}</div>
            <span>
              {education_start_date}
              {education_end_date}
            </span>
            <div> {education_description}</div>
          </div>
        </div>
        <div className="flex flex-col w-full gap-8 p-10 ">
          <div>
            <div className="text-2xl flex">
              <div>{first_name}</div>
              <div>{last_name}</div>
            </div>
            <div>
              <div className="text-xl mb-2"> {designation}</div>

              <div>{description}</div>
            </div>
          </div>
          <div>
            <div className="underline text-xl mb-2">ACHIEVEMENT</div>
            <div>
              <div>{achievement_title}</div>
              <div>{achievement_description}</div>
            </div>
          </div>
          <div>
            <div className="underline text-xl mb-2">WORK EXPERIENCE</div>
            <div>
              <div>{job_title}</div>

              <div className="flex gap-1">
                <div>{employeer}</div>
                <div>{location}</div>
                <div>{experience_start_date}</div>
                {experience_end_date && <div>to {experience_end_date}</div>}
              </div>

              <div>{experience_description}</div>
            </div>
          </div>
          <div>
            <div className="underline text-xl mb-2">PROJECT</div>
            <div>
              <div>{project_title}</div>
              <div>{project_description}</div>
              <div className="text-[blue]">{project_link}</div>
            </div>
          </div>
        </div>
      </div>

      <button type="button" onClick={handleDownloadPdf}>
        Download as PDF
      </button>
    </div>
  );
};

export default Template1;
